import randomimport stringimport uuidimport aux_dataprefix = aux_data.constants.LOGIN_PREFIXdef generate_random_string(str_length: int = 5) -> str:    chars = string.ascii_letters + string.digits + "!@#$%^&*"    return "".join(random.choices(chars, k=str_length))def generate_login(prefix:str =prefix) -> str:    postfix_length = 5    postfix = generate_random_string(postfix_length)    login = f"{prefix}_{postfix}"    return logindef generate_UUID() -> uuid.UUID:    return uuid.uuid4()